import React, { Component } from "react";
import Carousel from "react-bootstrap/Carousel";
import styled from "styled-components";

const Styles = styled.div`
  .Carousel {
    width: 350px;
    height: 260px;
    padding: 20px;
    box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.5);
    background-color: rgb(255, 215, 0);
  }

  .Carousel h2 {
    font-family: Montserrat;
    font-size: 18px;
    line-height: 1;
    text-align: left;
    color: #4a4a4a;
    position: relative;
    padding: 5px;
  }

  .Carousel {
    margin: 20px auto;
    display: flex;
    flex-direction: column;
    align-items: center;
  }

  .Menuslice {
    padding: 10px 20px;
    height: 100%;
  }
  .Menuslice h3 {
    font-family: Montserrat;
    font-size: 22px;
    font-weight: 300;
    letter-spacing: 3.4px;
    text-align: left;
    color: #4a4a4a;
  }
`;

function MenuSlice2() {
  return (
    <Styles>
      <Carousel className="Carousel">
        <Carousel.Item>
            <h2>TODAY SPECIALY MENUES</h2>
        </Carousel.Item>

        <Carousel.Item></Carousel.Item>
      </Carousel>
    </Styles>
  );
}

export default MenuSlice2;
